"]},"id":"1147","type":"LinearColorMapper"},{"attributes":{"text":"\n        &lt;h1&gt; Dask Performance Report &lt;/h1&gt;\n\n        &lt;i&gt; Select different tabs on the top for additional information &lt;/i&gt;\n\n        &lt;h2&gt; Duration: 5365.99 s &lt;/h2&gt;\n        &lt;h2&gt; Tasks Information &lt;/h2&gt;\n        &lt;ul&gt;\n         &lt;li&gt; number of tasks: 7667 &lt;/li&gt;\n         \n&lt;li&gt; compute time: 132928.34 s &lt;/li&gt;\n&lt;li&gt; deserialize time: 165.38 s &lt;/li&gt;\n&lt;li&gt; disk-read time: 13.25 ms &lt;/li&gt;\n&lt;li&gt; transfer time: 45.88 s &lt;/li&gt;\n        &lt;/ul&gt;\n\n        &lt;h2&gt; Scheduler Information &lt;/h2&gt;\n        &lt;ul&gt;\n          &lt;li&gt; Address: tcp://169.228.130.74:7572 &lt;/li&gt;\n          &lt;li&gt; Workers: 25 &lt;/li&gt;\n          &lt;li&gt; Threads: 25 &lt;/li&gt;\n          &lt;li&gt; Memory: 116.50 GiB &lt;/li&gt;\n          &lt;li&gt; Dask Version: 2021.04.0 &lt;/li&gt;\n          &lt;li&gt; Dask.Distributed Version: 2021.04.0 &lt;/li&gt;\n        &lt;/ul&gt;\n\n        &lt;h2&gt; Calling Code &lt;/h2&gt;\n        &lt;pre&gt;\nfrom processor.default_accumulators import desired_output, add_processes_to_output\n\nfrom Tools.helpers import get_samples\nfrom Tools.config_helpers import redirector_ucsd, redirector_fnal\nfrom Tools.nano_mapping import make_fileset, nano_mapping\n\nfrom processor.meta_processor import get_sample_meta\n\noverwrite = True\nlocal = False\n\n# load the config and the cache\ncfg = loadConfig()\n\ncacheName = 'charge_flip_calc'\ncache = dir_archive(os.path.join(os.path.expandvars(cfg['caches']['base']), cacheName), serialized=True)\n\nyear = 2017\n\n# get a python dictionary of all NanoAOD samples\n# The samples definitions can be found in data/samples.yaml\nsamples = get_samples(year)\n\n# make a fileset, taking the definitions in Tools/nano_mapping.py\nfileset = make_fileset(['DY', 'TTZ', 'top',], samples, redirector=redirector_ucsd, small=False)\n#add back in:  \n\n# in order for cutflows to work we need to add every process to the output accumulator\nadd_processes_to_output(fileset, desired_output)\n\nhistograms = sorted(list(desired_output.keys()))\n\n#meta = get_sample_meta(fileset, samples)\n\nchunksize = 25000\n\nif local:\n\n    exe_args = {\n        'workers': 16,\n        'function_args': {'flatten': False},\n        \"schema\": NanoAODSchema,\n        \"skipbadfiles\": True,\n    }\n    exe = processor.futures_executor\n\nelse:\n    from Tools.helpers import get_scheduler_address\n    from dask.distributed import Client, progress\n    \n    scheduler_address = get_scheduler_address()\n    c = Client(scheduler_address)\n    \n    def unique(filename):\n        file, ext = os.path.splitext(filename)\n        counter = 0\n        while os.path.exists(filename):\n            counter += 1\n            filename = file + str(counter) + ext\n        return filename\n\n    tstart = time.time()\n    \n    from dask.distributed import performance_report\n    fname = unique(\"dask-report_chunksize=\" + str(chunksize/1000) + \"K.html\")\n    \n    exe_args = {\n        'client': c,\n        'function_args': {'flatten': False},\n        \"schema\": NanoAODSchema,\n        \"skipbadfiles\": True,\n        'savemetrics': True\n    }\n    exe = processor.dask_executor\n\nif not overwrite:\n    cache.load()\n\nif cfg == cache.get('cfg') and histograms == cache.get('histograms') and cache.get('simple_output'):\n    output = cache.get('simple_output')\n\nelse:\n    print (\"I'm running now\")\n    with performance_report(filename=fname):\n        output = processor.run_uproot_job(\n            fileset,\n            \"Events\",\n            charge_flip_calc(year=year, variations=[], accumulator=desired_output),\n            exe,\n            exe_args,\n            chunksize=chunksize,\n            )\n\n    cache['fileset']        = fileset\n    cache['cfg']            = cfg\n    cache['histograms']     = histograms\n    cache['simple_output']  = output\n    cache.dump()\n\n        &lt;/pre&gt;\n        "},"id":"1209","type":"Div"},{"attributes":{"data":{"bandwidth":{"__ndarray__":"Ax8xS27fREG+wxbdiH4XQcYYpFb1TV1BwALMKSYUZEEhRYMkclZYQcKbVoOLAXRBtgo6jg8meEF+g6uGpG+AQdlKOPhmXW1BRcRrVlQwdEHYttrZclF+QXxNf1MIb3BBzpoD2bGTYEF8WqXUW+NjQS18m88zCHJBad74GoZScEEq7dVTNvlnQTXxdcGZx2ZBPZTs3L47akFy2SavtWhUQY9pdak1bmxBHjF2maPSc0GmTHmgYTo2Qa6fEBLGRzVBQM/W3WkIHEFsm/eZC2FoQQ==","dtype":"float64","order":"little","shape":[26]},"bandwidth_text":["2.61 MiB","375.91 kiB","7.33 MiB","10.04 MiB","6.08 MiB","20.01 MiB","24.15 MiB","32.87 MiB","14.68 MiB","20.19 MiB","30.32 MiB","16.43 MiB","8.29 MiB","9.94 MiB","18.03 MiB","16.32 MiB","11.99 MiB","11.39 MiB","13.12 MiB","5.10 MiB","14.22 MiB","19.82 MiB","1.39 MiB","1.33 MiB","448.53 kiB","12.19 MiB"],"destination":["6","13","23","13","21","15","20","13","21","15","1","17","15","17","9","2","8","15","22","15","1","15","6","6","6","11"],"source":["13","20","15","15","15","17","17","17","17","6","6","6","24","24","24","11","11","11","1","1","3","3","11","24","1","21"]},"selected":{"id":"1286"},"selection_policy":{"id":"1287"}},"id":"1146","type":"ColumnDataSource"},{"attributes":{"axis":{"id":"1051"},"dimension":1,"ticker":null,"visible":false},"id":"1054","type":"Grid"},{"attributes":{"axis":{"id":"1193"},"dimension":1,"ticker":null,"visible":false},"id":"1195","type":"Grid"},{"attributes":{"data_source":{"id":"1002"},"glyph":{"id":"1031"},"hover_glyph":null,"muted_glyph":null,"nonselection_glyph":null,"selection_glyph":null,"view":{"id":"1034"}},"id":"1033","type":"GlyphRenderer"},{"attributes":{},"id":"1229","type":"AllLabels"},{"attributes":{"data":{"bandwidth":[27262922.45948155],"bandwidth-half":[13631461.229740774],"bandwidth_text":["26.00 MiB"],"type":["builtins.bytes"]},"selected":{"id":"1288"},"selection_policy":{"id":"1289"}},"id":"1177","type":"ColumnDataSource"},{"attributes":{"active_multi":null,"logo":null,"tools":[{"id":"1207"}]},"id":"1196","type":"To
